import React from "react";
import logo from '../newtradr-logo.svg';

function ContactUs() {
    return (
        <>
        <div className='ContactUs'> 
          <h2>Contact Us:</h2>
          <h1>Phone: (415)-741-9659</h1> 
          <h1>Email: administrator@newtradr.com</h1>
        </div>
        </>
      );
}

export default ContactUs;
